import React, { Component } from 'react';

import tesla from './images/tesla.jpeg';

import './App.css';

class HeaderKanan extends Component {
  render() {
    return (
      <div className="HeaderKanan">
        <header className="HeaderKanan-header">


{/*============================================================================== */}

                <div className="col-md-2 col-sm-6 offset-md-0">
              <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
              </button>
              <div className="collapse navbar-collapse" id="navbarSupportedContent">
                <ul className="navbar-nav mr-auto">
                  <li className="nav-item active">
                    <a className="nav-link" href="#" style={{fontSize:"15px"}}>Masuk <span className="sr-only">(current)</span></a>
                  </li>
                  <li className="nav-item">
                    <a className="nav-link" href="#" style={{fontSize:"15px"}}>Daftar</a>
                  </li>
                  </ul>
                </div>
                </div>

            {/* </nav> */}
          {/* </div>
        </div> */}

{/*============================================================================== */}


        </header>
      </div>
    );
  }
}

export default HeaderKanan;
